import React from 'react';
const button = document.querySelector('button');

const alertName = (product) => {
  alert(product.name);
  alert("hi");
}
onclick = (button) => {
  alertName(button);
}

button.addEventListener('click', alertName());

function ProductList() {
  // 배열 데이터
  const products = [
    { id: 1, info: { name: "사과", price: 1000 } },
    { id: 2, info: { name: "바나나", price: 1500 } },
    { id: 3, info: { name: "오렌지", price: 2000 } },
    { id: 4, info: { name: "포도", price: 2500 } },
  ];

  const elements = products.map((product)=>(
    <button key={product.id}>{product.info.name} - {product.info.price}원</button>
  ));
  return (
    <div>
      <h1>상품 목록</h1>
      <ul>
        <li>{elements}</li>
      </ul>
    </div>
  );
}

export default ProductList;
